(1, 'รวมแพ็คเกจ ตรวจสุขภาพของโรงพยาบาล', 'ตรวจสุขภาพ โรงพยาบาล', '', 'แพ็คเกจตรวจสุขภาพจาก 4 โรงพยาบาลชื่อดังมาให้ได้ศึกษา และลองเปรียบเทียบกัน', 1, NULL, 'image/IwrRGzqkFYKn2Rn0XvjIifju4dyYVR5CeRVHDJ8w.jpeg', 'image_title/laOFz7lRybr4js1XTuymz0p9gVLyOwQcavU2VvA0.jpeg', NULL, NULL, '2018-11-02 07:50:23', '2018-11-07 02:10:00');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(2, 'การตรวจสุขภาพสำหรับเด็กวัยรุ่นอายุ 13 – 18 ปี', 'ตรวจสุขภาพ วัยรุ่น', '', 'การเข้าพบแพทย์ตั้งแต่ช่วงวัยที่เข้าสู่วัยรุ่นทุก ๆ ปีจะช่วยให้แพทย์สามารถติดตามการเปลี่ยนแปลงทางร่างกาย อารมณ์ และพัฒนาการทางสังคมได้ และสามารถให้คำแนะนำเกี่ยวกับการหลีกเลี่ยงพฤติกรรมไม่พึงประสงค์ต่าง ๆ ที่ส่งผลต่อสุขลักษณะที่ไม่ดีได้อีกด้วย อย่างเช่นการสูบบุหรี่และการดื่มเหล้า เป็นต้น', 1, NULL, 'image/0XAsXoLwcgZ2JDYFZEhF42hKRpOV4EP9ftMpZB8f.jpeg', 'image_title/WqpWm14bJLiEPH9YuMT9d7Rt8pTgU1QhD1xGhF8s.jpeg', NULL, NULL, '2018-11-02 08:16:42', '2018-11-07 02:10:33');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(3, 'การตรวจสุขภาพประจำปีในผู้สูงอายุ', 'ตรวจสุขภาพ โรงพยาบาล ผู้สูงอายุ', '', 'หลายคนมักเข้าใจผิดว่า ถ้าแข็งแรงดีก็ไม่จำเป็นต้องตรวจสุขภาพ เพราะไม่น่าจะมีโรคอะไร ซึ่งนับเป็นความเข้าใจที่ผิดเนื่องจากบางโรคอาจไม่ค่อยมีอาการ คือถ้าไม่ตรวจก็ไม่รู้ ผู้สูงอายุบางคนไม่กล้าตรวจสุขภาพเพราะกลัวเจอโรค ไม่อยากรักษา หรือบางคนกลัวว่าจะสิ้นเปลืองเพราะสบายดี ตรวจไปก็เปลืองเงิน ซึ่งถือว่าเป็นความเข้าใจที่ผิดเช่นกัน เนื่องจากการตรวจสุขภาพ และพบโรคตั้งแต่ยังไม่มีอาการ หรือเพิ่งเริ่มเป็นใหม่ ๆ จะได้ผลการรักษาที่ดีมาก บางโรคก็รักษาหายขาด นอกจากนี้ผู้ที่รับการรักษาด้วยโรคใดโรคหนึ่งเป็นประจำ ก็สมควรได้รับการตรวจสุขภาพทั่วไปเช่นกัน', 1, NULL, 'image/qdALRLBYt8eF8SvHgEWpvs1tLV0lUctzOrx24lm7.jpeg', 'image_title/z6SmHJX9hfW0RhUMrkcT0vphOJNT5qObAjUmZkBh.jpeg', NULL, NULL, '2018-11-03 05:53:02', '2018-11-07 02:11:06');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(5, 'การตรวจสุขภาพสำหรับผู้ชายอายุ 65 ปีขึ้นไป ต้องตรวจอะไรบ้าง', 'ตรวจสุขภาพ', '', 'การเข้าพบแพทย์เป็นประจำจะสามารถช่วยเลี่ยงปัญหาที่อาจจะเกิดขึ้นในอนาคตได้ ยกตัวอย่างเช่น การที่คุณจะป้องกันความดันโลหิตสูงได้คือการเข้าตรวจร่างกายเป็นประจำ เป็นต้น อีกทั้งระดับน้ำตาลและคอเลสเตอรอลในเลือดที่สูงจะไม่แสดงอาการใด ๆ ในช่วงระยะแรกเริ่ม ซึ่งการตรวจเลือดง่าย ๆ จะสามารถตรวจพบภาวะทั้งสองได้ทันที', 1, NULL, 'image/D0bAl5wbymBfOUfWtI9Z6QB0lHAbPk9Z9WQe90IF.jpeg', 'image_title/7V6BgiC9Zkpbj1kuXqrP2N91CidY1mozx9v6WE2h.jpeg', NULL, NULL, '2018-11-03 05:17:46', '2018-11-07 02:11:24');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(6, 'ผลเสียจากโรคอ้วน', 'ลดความอ้วน', '', 'การมีภาวะน้ำหนักตัวเกินและโรคอ้วน ทำให้เกิดผลเสียต่อสุขภาพทั้งสุขภาพกายและสุขภาพจิตของผู้ป่วย จากผลการศึกษา พบว่า การที่ร่างกายมีน้ำหนักเกินร้อยละ 10 จะมีอายุสั้นกว่าคนที่มีน้ำหนักปกติถึงร้อยละ 13', 1, NULL, 'image/bayvupKlJcGK7nsQshuo2jshCrzN0XEVRLfaP07I.jpeg', 'image_title/PARVKkwFXwzwREGHftYtaBvdvnogS1X7qkxGlvT2.jpeg', NULL, NULL, '2018-11-03 05:47:40', '2018-11-07 02:11:35');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(7, '10 สมุนไพรลดไขมัน ลดคอเลสเตอรอล คอเฮลตี้ต้องไม่พลาด', 'ลดความอ้วน', '', 'ไขมันที่สะสมนำมาซึ่งปัญหาคอเลสเตอรอลสูง และทำให้เป็นโรคอ้วน รวมถึงโรคอื่นๆ ได้หลายโรค ซึ่งหากคุณต้องการลดความอ้วนอย่างเร่งด่วน นอกจากการออกกำลังกายและการควบคุมอาหารแล้ว การทานสมุนไพรที่มีส่วนช่วยในการลดน้ำหนักก็จะช่วยได้ดีเช่นกัน', 1, NULL, 'image/IwMJeZwYZn0qaWyQZ29H6l3pC4rEOAiSUC6RvLK6.jpeg', 'image_title/DRIosvzj0h8pqAsjpKwRECH98GLkfRS5cgjO88tO.jpeg', NULL, NULL, '2018-11-03 05:56:47', '2018-11-07 02:11:53');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(9, '10 เรื่องที่ต้องรู้ ก่อนจะเริ่มออกกำลังกาย อย่างจริงจัง', 'ลดความอ้วน', '', 'การออกกำลังกายคือส่วนสำคัญในการลดน้ำหนัก แต่การออกกำลังกายให้ได้ผลดี เราจำเป็นต้องเข้าใจหลักของการออกกำลังกาย เพื่อที่จะเผาผลาญไขมันออกจากร่างกายของเรา มีหลักง่ายๆอยู่สิบข้อสำหรับการออกกำลังกายเพื่อสุขภาพที่ดี', 1, NULL, 'image/vxa92Pr66QwZakhsqD5yudxgxOEPCF0eJpqZdqFU.jpeg', 'image_title/RNE0UjRZMGBXwsgvel7KxpFmkUt0MsPAohIPoT6y.jpeg', NULL, NULL, '2018-11-03 06:04:29', '2018-11-07 01:51:31');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(10, 'การแท้ง', 'สุขภาพผู้หญิง', '', 'การแท้ง คือ การสูญเสียทารกในครรภ์ไปก่อนระยะเวลา 20 สัปดาห์ของการตั้งครรภ์ การแท้งในที่นี้จะหมายถึงการแท้งที่เกิดขึ้นเอง (spontaneous abortion) ซึ่งไม่รวมถึงการยุติการตั้งครรภ์ด้วยวิธีอื่น', 1, NULL, 'image/5nqcnK16HYnYTB8RG1yZ2UujfPrgQOJ9dLEZ85uE.jpeg', 'image_title/O9BOULtLGcgM1aS0QhaDMvfxTeYzA78nXVAmmoNF.jpeg', NULL, NULL, '2018-11-03 06:18:34', '2018-11-07 03:48:36');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(11, 'รู้จักยาฝังคุมกำเนิด ประสิทธิภาพและผลข้างเคียงต่อสุขภาพที่ควรรู้', 'สุขภาพผู้หญิง', '', 'วิธีคุมกำเนิดโดยใช้ยาฝังคุมกำเนิด หรือ ยาคุมกำเนิดแบบฝัง (Contraceptive implant หรือ Implantable contraception) เป็นวิธีคุมกำเนิดแบบชั่วคราว', 1, NULL, 'image/12morEyOjAcyUwcpzw93oVSO53ICsJoX0TT9pl4g.jpeg', 'image_title/7KwIzWoaftXkkUBcyPsmR49Df0htsEPSJBgPIfND.jpeg', NULL, NULL, '2018-11-03 06:25:02', '2018-11-07 02:12:37');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(12, 'Norfloxacin', 'ยา', '', 'นอร์ฟลอกซาซิน (norfloxacin) เป็นยากลุ่ม ยาปฏิชีวนะ (antibiotic) ใช้สำหรับรักษาการติดเชื้อในระบบทางเดินปัสสาวะ ชนิดมีภาวะแทรกซ้อน ขนาดการใช้ยาในผู้ใหญ่ 400 มิลลิกรัม วันละสองครั้งเป็นเวลา 10-21 วัน', 1, NULL, 'image/h0RLGuWWRHi4BkU0JbdMr0qzvDknFTPnh0b3Fuvc.jpeg', 'image_title/RNFdd02Otz8Jfj1GQJOZl5yiO7BcmP1JTgCWoppx.jpeg', NULL, NULL, '2018-11-03 07:00:24', '2018-11-07 06:39:02');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(13, 'Ibuprofen', 'ยา ผู้สูงอายุ', '', 'ไอบูโพรเฟน (ibuprofen) เป็นยากลุ่ม ยาต้านการอักเสบชนิดไม่ใช่สเตียรอยด์ (NSAID) ยาสำหรับรับประทานยาเม็ด', 1, NULL, 'image/5EQXlA09HMjhYbWpJehPSDs0rfU5IlAiF2rSJVWs.jpeg', 'image_title/iMPpX6dwv3ZfSbTD7iQu3HB8CKdTfGY6ADZJrcfq.jpeg', NULL, NULL, '2018-11-03 07:06:26', '2018-11-07 06:07:58');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(14, 'โรคตับอักเสบ A คืออะไร?', 'ตรวจสุขภาพ วัยรุ่น ผู้สูงอายุ โรค', '', 'โรคตับอักเสบ A เป็นประเภทหนึ่งของโรคตับอักเสบที่เกิดจากการติดเชื้อไวรัสตับอักเสบ A ซึ่งนอกจากไวรัสชนิดนี้แล้วยังมีไวรัสและสาเหตุอื่นๆ ที่สามารถทำให้เกิดตับอักเสบได้ เช่นไวรัสตับอักเสบ B, C และโรคตับอักเสบที่เกิดจากแอลกอฮอล์', 1, NULL, 'image/oFlJSMqH4GQvFqaCjvNsQwncQ7A0JWG2xLCImQqI.jpeg', 'image_title/G9yB1r1JOWJ8DJZ21rNF2wVPGXYYVEHrm3iOrxcH.jpeg', NULL, NULL, '2018-11-07 03:59:45', '2018-11-07 04:00:58');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(15, 'โรคตับอักเสบดี คืออะไร?', 'วัยรุ่น ผู้สูงอายุ โรค', '', 'โรคตับอักเสบดีต้องพึ่งเชื้อตับอักเสบดีในการเพิ่มจำนวนเชื้อตัวเอง นั่นหมายความว่าผู้ที่จะติดเชื้อตับอักเสบดีได้ คือผู้ที่เคยติดเชื้อตับอักเสบดีมาก่อน', 1, NULL, 'image/FL0psnLEfDtqfVQ2t6FzSDUOCGl1oqgJAaaFPgG6.jpeg', 'image_title/liwTLWYNy2pfxUWIdulrbNLh0LTqktCUNNz7SjxP.jpeg', NULL, NULL, '2018-11-07 04:07:33', '2018-11-07 04:07:33');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(16, 'อาหารเป็นพิษ ภาวะอันตรายที่ไม่ควรมองข้าม', 'โรค อาหาร', '', '\"ภาวะอาหารเป็นพิษ\" หลายคนที่เกิดอาการขึ้นมาแล้ว ปล่อยปละละเลยไม่รีบรักษา อาจจะทำให้ร่างกายสูญเสียน้ำ เกิดภาวะช็อก หมดสติ จนถึงขั้นเสียชีวิตได้', 1, NULL, 'image/ZidTG6AUMwuvjXpc3fxrdza7CyM0ANsmoipGueEs.jpeg', 'image_title/cGWrTLlmD4ts9LrceDhsNo1Dp4DDVGVgGFN7CMz7.jpeg', NULL, NULL, '2018-11-07 04:42:06', '2018-11-07 09:36:30');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(17, '5 ประโยชน์ของน้ำมันมะกอก', 'ลดความอ้วน อาหาร โรค', '', 'คนที่ต้องการรักษาสุขภาพ มักเลือกที่จะเลี่ยงการปรุงอาหารโดยใช้น้ำมันเป็นหลัก แต่ถ้าหากเลี่ยงไม่ได้ น้ำมันมะกอก จะถูกนำมาใช้เป็นตัวเลือกแรก ๆ', 1, NULL, 'image/Hj2izYnsKIHSvhqTkNPOACgS3xLlFRdqoKwFp40L.jpeg', 'image_title/t4zrXWXhjtjrEY73hW7D2DgyiZEBScTezvvTQNvM.jpeg', NULL, NULL, '2018-11-07 04:49:01', '2018-11-07 09:17:15');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(18, 'ช่วยตัวเองบ่อย มีผลดีและผลเสียอย่างไร', 'วัยรุ่น เพศสัมพันธ์ เพศศึกษา', '', 'จริงอยู่ที่ว่าการช่วยตัวเองนั้นทำให้เรารู้สึกดี แต่ก็ทำให้ใครหลายคนแอบกังวลว่าตนเองมีความผิดปกติหรือไม่ หมกมุ่นเรื่องทางเพศมากไปหรือเปล่า หลายคนจึงเกิดภาวะขัดแย้งขึ้นในใจ เกรงว่าหากช่วยตัวเองมากไปอาจส่งผลเสียต่อร่างกายหรือกลัวว่าจะทำให้ไม่อยากพึ่งเพศตรงข้าม', 1, NULL, 'image/LXqsBNfmdAiV2anrQ5jUUnMApMl1oxDQSHOtBSdK.jpeg', 'image_title/vjJ4KBdb6UbOjTULiWaTbFHly0lhneoEl6bJaq8K.jpeg', NULL, NULL, '2018-11-07 07:58:00', '2018-11-07 09:11:20');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(19, 'อาการปวดประจำเดือน (Menstrual Cramps) คืออะไร', 'วัยรุ่น สุขภาพผู้หญิง ประจำเดือน เพศศึกษา', '', 'โดยอาการปวดประจำเดือนมีชื่อเรียกในทางการแพทย์ว่า Dysmenorrhea ซึ่งเป็นกลุ่มอาการปวดเกร็งหรือปวดเกร็งที่บริเวณท้องน้อยที่เกิดขึ้นมาก่อนที่จะเป็นประจำเดือนหรือในช่วงระหว่างการเป็นประจำเดือน', 1, NULL, 'image/py34xBNAinIrKsXyl4edY2VHLaR1e3lE0XLrXKsA.jpeg', 'image_title/DWVTMdHQsHD1DRA2sVBj1No6wcU6ze8bRmV94Z2E.jpeg', NULL, NULL, '2018-11-07 08:06:19', '2018-11-07 09:25:11');
INSERT INTO `posts` (`id`, `title`, `tags`, `article`, `description`, `status`, `posted_by`, `image`, `image_title`, `like`, `dislike`, `created_at`, `updated_at`) VALUES
(20, 'น้ำมันมะพร้าว เป็นไขมันอิ่มตัว สรุปดีหรือไม่ดีต่อสุขภาพ', 'ลดความอ้วน อาหาร โรค', '', 'ต้องทำความเข้าใจก่อนเลยว่าน้ำมันมะพร้าว เป็นน้ำมันที่ได้มาจากการสกัด โดยวิธีการสกัดน้ำก็จะมีรูปแบบทั้งเย็นและร้อน โดยจะใช้เนื้อมะพร้าวมาสกัด ซึ่งองค์ประกอบหลักสำคัญของน้ำมันมะพร้าวเลยก็จะเป็นกรดไขมันอิ่มตัว', 1, NULL, 'image/DI0IPY9gJe747ogdE72efue8Swemz3mWzVRj3fPE.jpeg', 'image_title/i8qotuqiI1BiGuM4zhSTi7XzmsPvrJccZDBVUPiU.jpeg', NULL, NULL, '2018-11-07 08:16:43', '2018-11-07 09:12:48');

